define("widget/purchase-mixin/ga",["mod/ga"],function(){var a={trackPurchaseEvent:function(b){Ark.ga.trackEvent("purchase",b,this.getTitle(),this.getPriceInCents())},trackRechargeEvent:function(b){Ark.ga.trackEvent("recharge",b,this.getTitle(),this.getPriceInCents())},trackEcommerce:function(b,d,f){var e=this.getPrice(),c=[b,d,e];if(d==="store"){Ark.ga.trackEcommerce(c,[b,this.getArticleId(),this.getTitle(),f||"",e,1])}else{Ark.ga.trackEcommerce(c,[b,d,"","",f||"",e,1])}}};return a});